import React from "react";

export default function ProjectNavItem(props) {
  return (
    <li
      className="project-nav-item"
      onClick={(e) => props.handleProjectClick(e)}
    >
      <div>
        <input
          type="text"
          className="type-project"
          placeholder="i.e. Summer Chores"
          ref={(input) => input && input.focus()}
          onKeyPress={(e) => props.handleProjectTitle(e)}
        />
        <span className="set-project"></span>
        {props.button ? (
          <button className="project-delete" onClick={handleProjectDeletion}>
            <i className="fa-solid fa-trash"></i>
          </button>
        ) : (
          ""
        )}
      </div>
    </li>
  );
}
